    "\n",
    "library(tidyverse) # metapackage of all tidyverse packages\n",
    "library(cluster) # clustering algorithms \n",
    "library(factoextra) # Hierarchial analysis\n",
    "library(ggplot2)  #powerful framework for creating visualisations in R.\n",
    "library(NbClust)  # tools for determining the optimal number of clusters in a dataset.\n",
    "library(dendextend, warn.conflicts = FALSE)  # Loads the dendextend package, which extends the functionality of dendrogram objects in R. The parameter warn.conflicts = FALSE suppresses warnings about conflicts with other packages.\n",
    "library(conflicted)  # Loads the conflicted package, which helps manage namespace conflicts between loaded packages, allowing you to resolve conflicts more easily.\n",
    "\n",
    "heartDiseaseClusteringData = read.csv(\"../input/pmim402-assignment-datasets/heart-c.csv\")\n",
    "head(heartDiseaseClusteringData, 10) # showing first 10 rows #use tail() to get last 6 (default) elements \n",
    "# for example you can also specify n=20 as the second parameter of these functions to view the first/last 20 rows\n",
    "suppressPackageStartupMessages(library(dendextend))\n",
