   "source": [
    "# **Task1:**\n",
    "# **K-means clustering**"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "loose-thirty",
   "metadata": {
    "papermill": {
     "duration": 0.052934,
     "end_time": "2024-02-25T18:33:46.570782",
     "exception": false,
     "start_time": "2024-02-25T18:33:46.517848",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "\n",
    "#### K-means is a rapid clustering algorithm designed to minimize the sum of squared errors (SSE) iteratively, thereby promoting greater intra-cluster cohesion and inter-cluster separation. It achieves this by iteratively minimizing the average Euclidean distance from each point to the initially assigned cluster centers, which are randomly positioned. This iterative optimization process persists until minimal changes in SSE and centroid allocation are observed, indicating convergence. However, K-means is inherently sensitive to initialization, often resulting in local optima, and it is limited to detecting spherical clusters, making it less suitable for high-dimensional data. Despite these constraints, K-means remains a valuable tool for exploring datasets and identifying clustering patterns, particularly in scenarios where the data exhibits clear spherical clusters and dimensionality is not excessively high.\n",
    "C. Patil and I. Baidari, ‘Estimating the Optimal Number of Clusters k in a Dataset Using Data Depth’, Data Sci. Eng., vol. 4, no. 2, pp. 132–140, Jun. 2019, doi: 10.1007/s41019-019-0091-y."
   ]
  },
