   "source": [
    "### ***Why should the attribute “class” in heart-c.csv (“num”) not be included for clustering?\n",
    "#### As clustering is an unsupervised technique, num attribute which is a heart disease diagnosis is removed to ensure the results are not biased towards this exisiting seperation. Using num to check the fidelity and reliance of work is suitable if cluster number is 2. X is removed as indexing for the patients would not be useful or related.   "
   ]
  },
