   "source": [
    "### ***Which features would you expect to be less useful when using K-means and why?\n",
    "#### We only include data that is already numeric another way which will be taken is to turn the columns that are factors to numeric. K-means algorithm is typically designed to work with continuous data, as it relies on distance metrics such as Euclidean distance, which are meaningful for continuous variables."
   ]
