    "#### Oldpeak represents excercise induced ST depression in Electerocardiographic analysis. Exercise-induced ST-segment depression is a reliable ElectroCardioGraph (ECG) finding for diagnosis of myocardial ischemia and Coronary Artery Disease (CAD). CAD is a condition where the major blood vessels supplying the heart are narrowed. The reduced blood flow can cause chest pain and shortness of breath.\n",
    "‘Evaluation of exercise stress test: ECG, symptoms, blood pressure, heart rate, performance’, Cardiovascular Education. Accessed: Feb. 12, 2024. [Online]. Available: https://ecgwaves.com/topic/exercise-stress-test-ecg-symptoms-blood-pressure-heart-rate-performance/\n",
