   "source": [
    "#### When method = \"wss\" is specified, it refers to the within sum of squares\" method. This method calculates the total within-cluster sum of squares, also known as the \"elbow\" criterion to help determine the optimal number of clusters in K-means clustering. The elbow criterion suggests that the optimal number of clusters is often found at the \"elbow\" point, where adding more clusters does not significantly reduce the within-cluster sum of squares. "
   ]
