    "fviz_nbclust(\n",
    "  x = heartDiseaseContinuous,\n",
    "  FUN = kmeans,    # Type of clustering\n",
    "  method = \"wss\",    # Within Sum of Squares method\n",
    "  k.max = 10,\n",
    "  linecolor = \"slateblue\"\n",
    ") +\n",
    "theme(\n",
    "  panel.grid.major = element_line()    # Add gridlines for clarity\n",
    ") +\n",
    "ggtitle(\"Elbow Method for K-means Clustering\")  +  # Set the main title using ggtitle\n",
    "geom_point(shape = 3 , col = 'pink')  # Add points with shape 3 and pink color\n"
   ]
