   "source": [
    "#Function to calculate SSE for different values of k to check the results\n",
    "calculate_sse <- function(data, k_max) {\n",
    "  sse <- vector()\n",
    "  for (k in 1:k_max) {\n",
    "    kmeans_model <- kmeans(data, centers = k)\n",
    "    sse[k] <- kmeans_model$tot.withinss\n",
    "  }\n",
    "  return(sse)\n",
    "}"
   ]
