   "source": [
    "# Define maximum value of k\n",
    "k_max <- 5\n",
    "\n",
    "# Calculate SSE for different values of k\n",
    "sse_values <- calculate_sse(heartDiseaseContinuous, k_max)\n",
    "\n",
    "# Plot SSE curve\n",
    "ggplot() +\n",
    "  geom_line(aes(x = 1:k_max, y = sse_values), color = \"slateblue\") +\n",
    "  geom_point(aes(x = 1:k_max, y = sse_values), color = \"orange\") +\n",
    "  labs(title = \"Elbow Method for K-means Clustering (SSE)\",\n",
    "       x = \"Number of clusters (k)\",\n",
    "       y = \"Sum of Squared Errors (SSE)\") +\n",
    "  theme_minimal()"
   ]
