    "#https://www.rdocumentation.org/packages/NbClust/versions/3.0.1/topics/NbClust\n",
    "# Perform the NbClust analysis. By default, distance=\"euclidean\".\n",
    "nbclust_result <- NbClust(heartDiseaseContinuous, distance = \"euclidean\", min.nc = 2, max.nc = 5, method = \"kmeans\")\n",
    "\n",
    "# Plot the NbClust results\n",
    "nbclust_plot <- fviz_nbclust(nbclust_result, linecolor = \"skyblue\") +\n",
    "  theme(panel.grid.major = element_line(), panel.grid.minor = element_line(color = \"gray\", size = 0.5))\n",
    "\n",
    "# Modify the shape of the points to a star\n",
    "nbclust_plot "
   ]
