   "source": [
    "#### The clustering results, suggesting two or three distinct clusters, find support in both the Dunn index and Hubert index values. These statistical metrics gauge the compactness and separation of clusters. Furthermore, this clustering alignment resonates with the categorical labels inherent in the dataset. For instance, variables like angiographic disease status and fasting blood sugar exhibit two categories, while others like the slope of the peak exercise ST segment, resting electrocardiographic results, exercise-induced angina,and thal categories present three distinct categories. This congruence between clustering outcomes and categorical labels underscores the meaningfulness of the clustering results, further reinforced by statistical validation.\n",
    "D. Bertsimas, A. Orfanoudaki, and H. Wiberg, ‘Interpretable clustering: an optimization approach’, Mach Learn, vol. 110, no. 1, pp. 89–138, Jan. 2021, doi: 10.1007/s10994-020-05896-2."
   ]
