   "source": [
    "# Perform the NbClust analysis. By default, distance=\"euclidean\".\n",
    "nbclust_result <- NbClust(heartDiseaseContinuous, distance = \"euclidean\", min.nc = 2, max.nc = 5, method = \"kmeans\", index = 'dunn')\n",
    "\n",
    "# Modify the shape of the points to a star\n",
    "nbclust_result \n",
    "\n",
    "# Extract Dunn's index values\n",
    "dunn_values <- nbclust_result$All.index\n",
    "\n",
    "# Plot Dunn's index\n",
    "ggplot(data.frame(NumClusters = 2:5, DunnIndex = dunn_values), aes(x = NumClusters, y = DunnIndex)) +\n",
    "  geom_line(color = \"skyblue\", size = 1) +\n",
    "  geom_point(color = \"red\", size = 3) +\n",
    "  labs(title = \"Dunn's Index for NbClust Analysis\",\n",
    "       x = \"Number of Clusters\",\n",
    "       y = \"Dunn's Index\") +\n",
    "  theme_minimal()"
   ]
  },
