   "source": [
    "##### Dunn's index is a measure used to evaluate the quality of clustering in a dataset. It aims to quantify the compactness and separation between clusters. The index is calculated by taking the ratio of the minimum inter-cluster distance to the maximum intra-cluster distance across all clusters. A higher Dunn's index indicates better clustering, with tighter clusters and greater separation between them. 2,3 and 4 seem to have good results, with 3 having the highest score by small margins. This is supported by the fact that many features in our dataset have 3 distinct values.  \n",
    "PyShark, ‘Dunn Index for K-Means Clustering Evaluation’, PyShark. Accessed: Feb. 12, 2024. [Online]. Available: https://pyshark.com/dunn-index-for-k-means-clustering-evaluation-using-python/"
   ]
