   "source": [
    "# add Plot gap statistic for K-means optimal cluster number search \n",
    "# https://www.rdocumentation.org/packages/factoextra/versions/1.0.7/topics/fviz_nbclust\n",
    "gap_stat_result <- fviz_nbclust(\n",
    "  x = heartDiseaseContinuous,  \n",
    "  FUN = kmeans,    \n",
    "  method = \"gap_stat\",\n",
    "  nboot = 30,    \n",
    "  k.max = 5,                                           \n",
    " linecolor = \"forestgreen\"\n",
    ") +\n",
    "theme(\n",
    "  panel.grid.major = element_line(color = \"black\")  # Add gridlines for clarity\n",
    ")\n",
    "\n",
    "# Print the result\n",
    "gap_stat_result <- gap_stat_result + geom_point(shape = 8,color = \"steelblue\", size = 3)\n",
    "print(gap_stat_result)"
   ]
