   "source": [
    "#### This confirms 2 clusters would be optimal for K-means as the gap statistic is maximized at k=2. The gap statistic is a valuable tool for estimating the optimal number of clusters in a dataset. A high gap statistic suggests that the observed within-cluster dispersion is significantly larger than expected under the null reference distribution, indicating that the data may be inherently complex and require a larger number of clusters to capture its structure adequately. In contrast, a low gap statistic indicates that the observed within-cluster dispersion is similar to what would be expected by chance, suggesting that the data may be relatively simple and can be adequately represented with fewer clusters."
   ]
