   "source": [
    "# Define the range of number of clusters to try\n",
    "k_range <- 2:10  # Adjust the range as needed\n",
    "\n",
    "# Initialize an empty list to store K-means results\n",
    "kmeans_results <- list()\n",
    "\n",
    "# Perform K-means clustering for each number of clusters in the range\n",
    "for (k in k_range) {\n",
    "  # Perform K-means clustering\n",
    "  kmeans_results[[k]] <- kmeans(heartDiseaseContinuous, centers = k)\n",
    "  \n",
    "  # Visualize the clustering results\n",
    "  plot_title <- paste(\"K-means Clustering with\", k, \"Clusters\")\n",
    "  print(fviz_cluster(kmeans_results[[k]], geom = \"point\", data = heartDiseaseContinuous, main = plot_title))\n",
    "}"
   ]
