   "source": [
    "# kmeans can only be used on numerical columns, because it needs to compute the mean.\n",
    "# Perform k-means clustering\n",
    "K <- kmeans(heartDiseaseContinuous, centers = 2)\n",
    "\n",
    "# Plot the data points\n",
    "plot(heartDiseaseContinuous, col = K$cluster, main = \"K-means Clustering\")\n",
    "\n",
    "# Add cluster centroids\n",
    "points(K$centers, col = 1:2, pch = 8, cex = 2)\n",
    "\n",
    "# Add cluster boundaries\n",
    "for (i in 1:2) {\n",
    "  lines(c(min(heartDiseaseContinuous[, 1]), max(heartDiseaseContinuous[, 1])), \n",
    "        c(K$centers[i, 2], K$centers[i, 2]), \n",
    "        col = i, lty = 2)\n",
    "  lines(c(K$centers[i, 1], K$centers[i, 1]), \n",
    "        c(min(heartDiseaseContinuous[, 2]), max(heartDiseaseContinuous[, 2])), \n",
    "        col = i, lty = 2)\n",
    "}\n"
   ]
