   "source": [
    "# Calculate accuracy\n",
    "calculate_accuracy <- function(actualLabels, predictedLabels) {\n",
    "  if (length(actualLabels) != length(predictedLabels)) {\n",
    "    stop(\"Length of actualLabels and predictedLabels must be the same\")\n",
    "  }\n",
    "  \n",
    "  # Compare actual labels with predicted labels\n",
    "  correct_predictions <- sum(actualLabels == predictedLabels)\n",
    "  \n",
    "  # Calculate accuracy\n",
    "  accuracy <- correct_predictions / length(actualLabels)\n",
    "  \n",
    "  return(accuracy)\n",
    "}\n",
    "# Assuming you have the actual labels in actualLabels\n",
    "actualLabels <- heartDiseaseDiagnosis  # Example actual labels\n",
    "k_range <- 6\n",
    "# Initialize an empty list to store accuracies for each k\n",
    "accuracies <- numeric(length(k_range))\n",
    "\n",
    "# Perform K-means clustering for each number of clusters in the range\n",
    "for (i in seq_along(k_range)) {\n",
    "  k <- k_range[i]\n",
    "  \n",
    "  # Perform K-means clustering\n",
    "  kmeans_results <- kmeans(heartDiseaseContinuous, centers = k)\n",
    "  \n",
    "  # Calculate accuracy\n",
    "  predictedLabels <- kmeans_results$cluster\n",
    "  accuracies[i] <- calculate_accuracy(actualLabels, predictedLabels)\n",
    "  \n",
    "  # Visualize the clustering results\n",
    "  plot_title <- paste(\"K-means Clustering with\", k, \"Clusters\")\n",
    "  print(fviz_cluster(kmeans_results, geom = \"point\", data = heartDiseaseContinuous, main = plot_title))\n",
    "}\n",
    "\n",
    "# Print accuracies\n",
    "print(paste(\"Accuracies for each k:\", paste(accuracies, collapse = \", \")))\n"
   ]
  },
