    "tags": []
   },
   "source": [
    "##### Hierarchical analysis is a method of data mining clustering that create and impose a hierarchical tree structure to the data. The main differnce with K-means is that in K-means you need to know what is the number of pre-determined clusters (K) whereas in higherarchical analysis, hierarchy of clusters is formed and the clustering occurs without knowing the number of clusters. This method can handle a variety of data types. However, it can incur high cost in terms of Computational power. There are two main approaches taken in hierachical analysis\n",
    "1. Agglomerative 'bottom-up' hierachical clustering starts with placing each data point within its own clusters, then by utilising some linkage criterion, it can merge similar clusters until all data points are placed within one cluster.\n",
    "2. Divisive 'top-down' Hierarchical clustering is the opposite of agglomerative clustering. It initiates by placing all data points within one individual cluster and iteratively separates data points that are dissimmilar to the cluster they were assigned to. Finally all individual data points are placed in their own cluster.\n"
   ]
  },
