   "source": [
    "##### Here multiple Linkage methods are mentioned and its strength and weakness is noted:\n",
    "##### Average linkage:\n",
    "* Calculates inter-cluster distance as the average distance between all cross-pair points.\n",
    "* Tends to produce similar-sized clusters and is robust to outliers.\n",
    "* Can cause chaining where clusters link due to distant points.\n",
    "##### Single linkage:\n",
    "\n",
    "* Calculates distance as the shortest distance between any cross-pair points.\n",
    "* Tends to yield elongated clusters and is outlier-sensitive.\n",
    "* Less prone to chaining than average linkage.\n",
    "##### Complete linkage:\n",
    "\n",
    "* Calculates distance as the farthest distance between any cross-pair points.\n",
    "* Tends to produce compact, spherical clusters but outlier-sensitive.\n",
    "* Can cause crowding where tight clusters are split up.\n",
    "##### Ward’s minimum variance method:\n",
    "\n",
    "* Merges clusters to minimize increase in total within-cluster variance.\n",
    "* Distance based on variance increase from merging clusters.\n",
    "* Tends to produce equal-sized, compact clusters and is outlier-resistant.\n",
    "* More computationally intensive but often high quality."
   ]
  },
