   "source": [
    "##### When using hierarchical clustering, a dendrogram visualises the fusing of data points into clusters. The optimal number of clusters can be determined by inspecting the dendrogram for natural breakpoints. These breakpoints indicate clear separations between clusters. One approach is to look for points where the branch heights suddenly increase. This suggests distinct divisions between clusters. The optimal number can also be identified quantitatively. Methods like the elbow method or silhouette analysis evaluate different numbers of clusters. They determine when adding more clusters does not improve quality. The optimal number balances cohesion within clusters and separation between clusters. It produces clusters that are compact within themselves yet well-differentiated from each other. The best number is found by combining visual inspection of the dendrogram breakpoints with quantitative measures of clustering performance.\n",
    "\n",
    "‘hclust: Hierarchical Clustering’. Accessed: Feb. 12, 2024. [Online]. Available: https://rdrr.io/r/stats/hclust.html"
   ]
  },
