   "source": [
    "# Hierarchical clustering\n",
    "dist_mat <- dist(heartDiseaseContinuous, method = 'euclidean')\n",
    "hclust_avg <- hclust(dist_mat, method = 'average')\n",
    "\n",
    "# Convert hierarchical clustering result to dendrogram object\n",
    "avg_dend_obj <- as.dendrogram(hclust_avg)\n",
    "\n",
