   "source": [
    "####  Ward.D and Ward.D2 exhibit minor discrepancies, particularly noticeable in the individual data points' heights within each cluster. While both methods yield comparable top-level clustering outcomes, Ward.D2, implementing Ward's method more precisely, manifests slight variations in the height distribution across individual data points and clusters.\n",
    "##### The only difference between ward.D & ward.D2 is the input parameter. hclust(dist(x)^2,method=\"ward.D\") ~ hclust(dist(x)^2,method=\"ward\") which are equivalent to: hclust(dist(x),method=\"ward.D2\")\n",
    "\n",
    "anakin, ‘Answer to “What algorithm does ward.D in hclust() implement if it is not Ward’s criterion?”’, Cross Validated. Accessed: Feb. 12, 2024. [Online]. Available: https://stats.stackexchange.com/a/109962\n",
    "\n"
   ]
