   "source": [
    "# Perform hierarchical clustering using Ward's method with squared Euclidean distances\n",
    "hclust_avg <- hclust(dist_mat, method = 'ward.D2')\n",
    "plot_title <- \"Dendrogram Using Ward's Linkage Method\"\n",
    "\n",
    "# Plot the dendrogram of hierarchical clustering\n",
    "plot(hclust_avg, main = plot_title)\n",
    "grid()\n",
    "# Highlight the clusters by drawing rectangles around them\n",
    "rect.hclust(hclust_avg , k = 3, border = 2:6) # Highlight clusters with different colors\n",
    "\n",
    "abline(h = 19, col = 'purple')\n",
    "abline(h = 23.7, col = 'steelblue')\n",
    "abline(h = 14.4, col = 'cyan')\n"
   ]
