    "#### ***Describe the link method you used.\n",
    "#### ***What are the strengths and limitations of this link method in hierarchical clustering?\n",
    "Ward's method, also known as Ward linkage, is often considered the best choice for hierarchical clustering when dealing with large datasets for several reasons: \n",
    "https://www.statisticshowto.com/wards-method/\n",
    "\n",
    "F. Murtagh and P. Legendre, ‘Ward’s Hierarchical Agglomerative Clustering Method: Which Algorithms Implement Ward’s Criterion?’, J Classif, vol. 31, no. 3, pp. 274–295, Oct. 2014, doi: 10.1007/s00357-014-9161-z.\n",
    "\n",
    "* Robustness to Noise: Ward's method minimises the variance when merging clusters. By considering the sum of squares, it aims to minimize the within-cluster variance, resulting in robust clusters less affected by noise or outliers.\n",
    "\n",
    "* Balanced Cluster Sizes: Ward's method tends to produce clusters of relatively equal sizes. This is beneficial when dealing with large datasets as it ensures that each cluster contains a meaningful amount of data, facilitating interpretation and analysis.\n",
    "\n",
    "* Hierarchy Interpretability: The hierarchical structure produced by Ward's method is often easier to interpret compared to other methods. This is crucial for understanding the relationships and organization within large datasets, especially when dealing with complex data structures.\n",
    "\n",
    "* Computationally Efficient: Although Ward's method involves calculating the distance between clusters, it is computationally efficient compared to some other linkage methods. This efficiency is particularly advantageous when working with large datasets, as it reduces the computational burden and allows for faster analysis.\n",
    "\n",
    "Overall, Ward's method strikes a balance between robustness, interpretability, and computational efficiency, making it well-suited for hierarchical clustering tasks, especially when dealing with large datasets."
   ]
  },
