    "# Perform hierarchical clustering with different linkage methods\n",
    "methods <- c(\"average\", \"single\", \"complete\", \"ward.D2\")\n",
    "plot_titles <- c(\"Average Linkage\", \"Single Linkage\", \"Complete Linkage\",\"Ward Linkage\")\n",
    "\n",
    "par(mfrow = c(2, 2), mar = c(5, 4, 4, 2))\n",
    "\n",
    "for (i in 1:length(methods)) {\n",
    "  hierarchical_clusters <- hclust(dist_mat, method = methods[i])\n",
    "  \n",
    "  # Determine the optimal number of clusters based on height differences\n",
    "  height_diff <- abs(diff(hierarchical_clusters$height))\n",
    "  optimal_clusters <- which.max(height_diff) + 1\n",
    "  \n",
    "  # Visualize the hierarchical clustering dendrogram\n",
    "  plot(hierarchical_clusters, main = plot_titles[i], xlab = \"Observations\", ylab = \"Height\")\n",
    "  \n",
    "  # Indicate the optimal number of clusters with a dashed line\n",
    "#   abline(h = hierarchical_clusters$height[optimal_clusters - 1], col = \"red\", lty = 2)\n",
    "#   text(optimal_clusters - 1, hierarchical_clusters$height[optimal_clusters - 1], \n",
    "#        labels = paste(\"Optimal clusters:\", optimal_clusters), pos = 3, col = \"red\")\n",
    "}\n",
    "\n",
    "# Reset plotting parameters\n",
    "# par(mfrow = c(2, 4), mar = c(5, 4, 4, 2))\n"
   ]
