   "source": [
    "##### The Diana algorithm, as detailed in Chapter 6 of Kaufman and Rousseeuw's work (1990), stands out as a unique approach to hierarchical clustering due to its divisive nature, contrasting with the more common agglomerative methods found in most clustering software. Unlike agglomerative methods that merge clusters, Diana starts with a single cluster containing all observations and iteratively divides clusters until each contains only one observation. At each step, the algorithm selects the cluster with the largest diameter (the greatest dissimilarity between any two observations within the cluster) for division. It identifies the most disparate observation within the selected cluster, which becomes the nucleus for the new cluster. Subsequent steps involve reassigning observations closer to this nucleus than to the original cluster, resulting in a split into two new clusters. Diana provides valuable metrics such as the divisive coefficient, measuring the extent of clustering structure, and offers a novel graphical display known as the banner through the plot.diana function.\n",
    "​\n",
    "‘R: DIvisive ANAlysis Clustering’. Accessed: Feb. 12, 2024. [Online]. Available: https://stat.ethz.ch/R-manual/R-devel/library/cluster/html/diana.html"
   ]
  },
