   "source": [
    "# Customise dendrogram visualisation\n",
    "plot_divisive <- fviz_dend(\n",
    "  divisive_clusters,\n",
    "  main = \"Divisive Hierarchical Clustering\",\n",
    "  cex = 0.2,  # Adjust leaf node label size\n",
    "  ylab = \"Dendrogram Height\"  # Label for the y-axis\n",
    ") \n",
    "\n",
    "# Adjust the y-axis\n",
    "plot_divisive <- plot_divisive + scale_y_continuous(\n",
    "  n.breaks = 10  # Number of breaks on the y-axis\n",
    ")\n",
    "\n",
    "# Display the plot\n",
    "print(plot_divisive)\n"
   ]
