   "source": [
    "# Customise dendrogram visualisation\n",
    "plot_divisive <- fviz_dend(\n",
    "  divisive_clusters,\n",
    "  main = \"Divisive Hierarchical Clustering of Heart Data (Continuous Variables)\",\n",
    "  cex = 0.7,  # Increase leaf node label size\n",
    "  k_colors = c(\"steelblue\", \"pink\", \"forestgreen\"),  # Set custom color palette\n",
    "  k = 3,  # Display five clusters\n",
    "  rect = TRUE,  # Add rectangles around clusters\n",
    "  rect_border = \"black\",  # Set border color of rectangles\n",
    "  rect_fill = TRUE,  # Fill rectangles with cluster colors\n",
    "  horiz = TRUE,  # Display dendrogram horizontally\n",
    "  ylab = \"Dendrogram Height\",  # Label for the y-axis\n",
    "  xlab = \"Distance\",  # Label for the x-axis\n",
    "  cex.main = 1.2,  # Increase main title font size\n",
    "  cex.axis = 0.8,  # Adjust axis label font size\n",
    "  cex.lab = 0.9,  # Adjust axis tick label font size\n",
    "  cex.sub = 0.8,  # Adjust sub-title font size\n",
    "  hline_y = divisive_clusters$height[which.max(height_diff)]  # Add horizontal line at optimal cluster height\n",
    ")\n",
    "\n",
    "# Adjust the y-axis\n",
    "plot_divisive <- plot_divisive + scale_y_continuous(\n",
    "  n.breaks = 10,  # Number of breaks on the y-axis\n",
    "  expand = c(0.01, 0.05)  # Expand y-axis limits\n",
    ")\n",
    "\n",
    "# Display the plot\n",
    "print(plot_divisive)\n"
   ]
